import React, { Component } from 'react';
import axios from 'axios';
import Spinner from '../components/Spinner/Spinner';

class Account extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
            loading: false
        };
        this.loginHandler = this.loginHandler.bind(this);
        this.changeHandler = this.changeHandler.bind(this);
    }

    componentDidMount() {
        if(this.props.isAuthenticated) {
            const cars = [
                {
                    "id": 1,
                    "make": "Toyota",
                    "model": "Camry",
                    "year": "2019"
                },
                {
                    "id": 2,
                    "make": "Ford",
                    "model": "Fiesta",
                    "year": "2016"
                }
            ]
            const issues = [
                {
                    "id": 1,
                    "name": "Airbag malfunction in 2007 serial numbers",
                    "description": "There has been a recall of all Toyota Camry cars with 2007 serial numbers"
                },
                {
                    "id": 2,
                    "name": "Airbag malfunction in 2008 serial numbers",
                    "description": "There has been a recall of all Toyota Camry cars with 2008 serial numbers"
                }
            ]

            axios.defaults.headers = {
                "Content-Type": "application/json",
                Authorization: `Token ${this.props.token}`
            };

            axios
                .get('http://127.0.0.1:8000/api/cars/')
                .then(res => {
                    this.setState({ cars: res.data });
                })
                .catch(err => {
                    console.log(err);
                });


        }
    }

    changeHandler = (event) => {
        this.setState({[event.target.name]: event.target.value});
    }

    loginHandler(event) {
        event.preventDefault();

        this.setState({loading: true});
        this.setState({loading: false});
    }

    render() {
        return (
            <div className="Account">
                <div class="row">
                    <div class="col">
                        <h1 className="page-title display-4">Your Account</h1>
                    </div>
                </div>
                <div class="row justify-content-md-center mb-4 mt-4">
                    <div class="col-4">

                    </div>
                </div>
            </div>
        );
    }
}

export default Account;
